import { actionTypes } from '../actions/items.action';

const initialState = {
  data: [{

  }]
}

export default (state = initialState, action) => {
  switch (action.type) {
    
    case 'INDEX_ITEMS':
      return action.payload;

    default:
      return state;
  }
}
